INSERT INTO `Agreement` VALUES (1,'2013-07-08 18:40:59','CONTRATO DE ARRENDAMIENTO DE VEHICULO\n\nEn Santiago, a [$fecha_arriendo], entre don/ña [$nombre_dueno], cédula de identidad [$rut_dueno] , domiciliado en [$domicilio_dueno], comuna de [$comuna_dueno], de la ciudad de Santiago, en adelante el Arrendador, y don/ña [$nombre_usuario], cédula de identidad [$rut_usuario], domiciliado en [$domicilio_usuario], comuna de [$comuna_usuario], de la ciudad de Santiago, en adelante el arrendatario, se ha convenido el siguiente contrato de arriendo sobre vehículo haciendo uso de Arriendas.cl en conformidad a los Termínos y Condiciones de Uso del sistema. Todo arriendo o extensión al arriendo realizado por las partes, sin el uso del sistema Arriendas.cl o en no conformidad con los Términos y Condiciones de Uso de Arriendas.cl, extingue la aplicación del presente contrato al que las partes por el presente suscriben: PRIMERO: Por este instrumento, [$nombre_dueno] da en arrendamiento a [$nombre_usuario], quien acepta para sí, el vehículo marca [$marca_auto], modelo [$modelo_auto], año [$ano_auto], placa patente [$patente_auto]. SEGUNDO: El Arrendador declara que salvo por [$listado_de_daños_registrados_por_el_usuario] + [$listado_de_daños_registrados_por_el_seguro], el vehículo referido se encuentra en perfecto estado mecánico y de funcionamiento, con su equipo y accesorios completos y con la correspondiente placa patente, padrón del vehículo, permiso de circulación, seguro obligatorio y revisión técnica al día. Al efecto, declara el arrendador el correcto funcionamiento de sus frenos, luces, dirección, señalizaciones de viraje y detención, neumático de repuesto, triángulos y demás accesorios y mecanismos de seguridad según lo previsto en la Ley del Transito. TERCERO: El presente contrato tendrá una duración de [___] a partir de [___] incluidas las posteriores extensiones a la hora de finalización del arriendo, aprobadas y realizadas por las partes, a través de Arriendas.cl. El arrendatario estará siempre obligado a restituir el vehículo dado en arrendamiento en las mismas buenas condiciones mecánicas y de funcionamiento del momento de iniciación del arrendamiento y junto con los accesorios y equipos señalados precedentemente. En todo caso, si no hiciera entrega del vehículo en plazo, forma y condiciones expresadas anteriormente, cualquiera sea la situación o circunstancia, le quedará al arrendatario prohibido hacer uso del vehículo, cesando, además, toda la responsabilidad de la arrendadora por los hechos o actos que sobrevinieran a partir del plazo pactado para la entrega, sin perjuicio de la responsabilidad de aquel retardo.-CUARTO: En todo caso, si el arrendatario quisiere prolongar el plazo de arrendamiento, deberá notificar tal manifestación de voluntad a la arrendador a través de una extensión de la reserva, utilizando Arriendas.cl al menos 30 minutos antes del vencimiento de dicho plazo, la cual podrá autorizar, a su arbitrio, en la misma forma, dicha prórroga. QUINTO: La renta de arrendamiento del vehículo será del [$precio del arriendo neto de la comisión de Arriendas.cl y comisión por pago del Seguro] por la que se pagará al momento de la confirmación de la reserva, con tarjeta de crédito. El precio de las extensiones a la reseva, realizadas y aprobadas por las partes, haciendo uso de Arriendas.cl, se calculará aplicando la misma tarifa por hora o día utilizada en el cálculo del arriendo. Dichas extensiones serán pagadas por el arrendatario, con posterioridad a la finalización del arriendo en un plazo no mayor a 7 días, con tarjeta de crédito. SEXTO: La no devolución oportuna del vehículo dado en arrendamiento facultará al arrendador para cobrar las rentas devengadas conforme a lo dispuesto en la clausula quinta de este contrato, para exigir la devolución del vehículo, y recibir un pago adicional establecido en la sección de “Multas” en términos y condiciones de uso de Arriendas.cl, más el pago de los gastos que se originen y el pago de la renta según el método de aplicación de precios utilizado establecido por el arrendasdor en Arriendas.cl, hasta el día en que se hace efectiva la entrega. SEXTO B. Los costos por pagos de peajes y los costos por la bencina consumida durante el arriendo serán pagados por el arrendatario. En caso de que el vehículo haya sido equipado con el GPS Tracker Arriendas.cl, por Arriendas.cl, el arrendador se obliga registrar los kilómetros recorridos haciendo uso del Hardware entregado por Arriendas.cl o introduciendo el kilométraje por mensaje de texto como se define en los Términos y Condiciones de Arriendas.cl. En caso de que el vehículo no haya sido equipado con el GPS Tracker Arriendas.cl, o que el mismo se encuentre fuera de funcionamiento, habiendo dejado previa constancia el Arrendador en el sistema Arriendas.cl, el arrendatario se obliga a devolver el vehículo reestableciendo el nivel de bencina expuesto en el indicador, al mismo nivel que cuando le fue entregado el vehículo. El arrendatario debe declarar la utilización del TAG, la hora en la que fue utilizado, la localización y la cantidad de veces que lo haya utilizado durante el arriendo. El pagos, de ambos gasto, se realiza con tarjeta de crédito a partir del momento de la finalización del arriendo haciendo uso del sistema. SEPTIMO: El presente contrato se considerará terminado por la violación de cualquiera de las prohibiciones que se detallan en la cláusula octava; y, especialmente, por: a) Permitir que sea manejado por cualquier persona no autorizada, ni aun ocasionalmente; b) Destinarlo a un uso distinto del estipulado o usual, al transporte remunerado, o al uso como automóvil de servicio público; c) Utilizarlo en labores peligrosas, delictuales o ilícitas, como apuestas, desafíos, carreras, u otras similares; e) Remolcar o empujar otros vehículos; f) Conducir bajo el efecto del alcohol, drogas, u otros estupefacientes; g) Manejar sin portar los documentas o licencias exigidos por la autoridad; h) Llevarlo fuera del territorio nacional; En caso de terminación del presente contrato, y cualquiera fuere la causa, el arrendatario deberá facilitar, por el solo requerimiento del arrendador, la entrega del vehículo, a la persona que aquél designare, sin necesidad de mandato o acción judicial, sin la intervención de autoridad alguna y sin justificación de ninguna clase, renunciando expresamente, el arrendatario, desde ahora, para oponerse, de algún modo o por cualquier medio, a la actuación del arrendador o de quien él nombrare, en tal sentido. La terminación del presente contrato por cualquiera de estas razones, no genera un crédito a favor del arrendatario por las horas o días en que el arriendo no hubiera sido gozado. OCTAVO: El vehículo objeto del presente contrato deberá ser manejado única y exclusivamente por el usuario contratante o por los otros conductores autorizados por escrito por la arrendadora al suscribirlo, debiendo en tal caso constar los nombres en el anexo, los cuales en ningún caso podrán ser menores de edad. Por consiguiente, queda totalmente prohibido que el vehículo sea conducido por menores de de edad y que si ello ocurriese es de absoluta y única responsabilidad del arrendatario, aceptando desde ya la cancelación de todos perjuicios que pueda causar al vehículo, al arrendador y a terceros. Así mismo está expresamente prohibido sub-arrendar el vehículo o ceder a cualquier título en arrendamiento o mera tenencia del vehículo. NOVENO: El arrendatario declara bajo juramento haber declarado la verdad, y que el total de los datos y antecedentes proporcionados y que proporcionará respecto del arrendatario, usuario y conductores autorizados, acerca de su identidad, edad, profesión, estado civil, domicilio, aptitud física y psíquica para conducir y posesión legal de licencia para conducir vehículos son verdaderos, por lo que el mismo arrendatario será el único y exclusivo responsable de las consecuencias legales de una eventual falsedad al respecto, que pudieran sobrevenir. Esta absolutamente prohibido sacar el vehículo del territorio nacional, sin autorización previa del arrendador. DECIMO: El vehículo arrendado mediante la utilización del sistema Arriendas.cl, se encuentra asegurado por____________, con las siguientes coberturas: daños contra terceros, daños propios, responsabilidad civil hasta ____UF, robo y hurto, terrorismo y actos maliciosos, riesgos de la naturaleza, terremoto, y pérdida total con un deducible por toda y cada pérdida de ___UF. Los arriendos o extensión de los arriendos realizados por las partes, sin el uso del sistema Arriendas.cl o en no conformidad con los Términos y Condiciones de uso del sistema Arriendas.cl tendrán acceso a de la Cobertura de Seguros aquí descripta. UNDECIMO: Si por causa de accidente o robo, el vehículo debe ser reparado; o si por violación de las leyes del tránsito, éste vehículo es retenido por las autoridades, entre otras circunstancias, el arrendatario pagará, de todos modos, al arrendador o a quien éste mandate, el monto de la renta de arrendamiento convenido, por todo el tiempo que dure la reparación o los trámites legales para la liberación o recuperación del vehículo, así como todos los gastos de cualquier naturaleza en que se incurra, para lo cual autoriza la retención de los montos respectivos de cualquier garantía que otorgue. DECIMO SEGUNDO: El arrendatario se obliga expresamente a observar y cumplir todos los reglamentos, disposiciones y ordenanzas del tránsito, como también las instrucciones que impartan las autoridades o sus agentes y a conducir el vehículo con todos los documentos y licencias exigidos por la autoridad. Serán, pues, de su cargo exclusivo, todos y cualquier tipo de multas y sanciones cualesquiera fuese su monto, naturaleza u origen, sea que deriven de delitos, cuasidelitos o faltas que cometa el mismo, el usuario u otros conductores. Ahora bien, dado que el arrendador no puede física ni materialmente controlar el manejo o conducción por parte del arrendatario, usuario o conductores autorizados y, habida consideración que la observancia de las prescripciones y la veracidad de las declaraciones contenidas en el presente contrato han sido determinantes para la celebración del mismo por parte de la arrendadora, se deja expresa constancia que la infracción de aquellas o falsedad de estas eximirá a la arrendadora de toda responsabilidad sobreviviente. Si por cualquier motivo el arrendatario, usuario o conductores autorizados quedasen impedidos de manejar el vehículo materia del contrato, el arrendatario deberá dar aviso al arrendador para que este, con cargo al primero, envíe una persona que haya de conducir el vehículo hasta el lugar donde se ha obligado a devolverlo. DECIMO TERCERO: En caso de cualquier accidente o daños que sufra el vehículo arrendado, el arrendatario deberá cumplir con las siguientes obligaciones: a) El conductor deberá dejar constancia por escrito en Carabineros de Chile de las circunstancias en que concurrieron en el hecho dentro de un plazo máximo de una hora de ocurrido el mismo, salvo fuerza mayor o caso fortuito; en tal situación deberá hacerlo inmediatamente de superado el inconveniente; b) El arrendatario o conductor autorizado deberá exponer por escrito y detalladamente a la arrendadora las circunstancias que concurrieron en el hecho dentro de un plazo máximo de 3 horas de ocurrido el mismo, salvo fuerza mayor o caso fortuito, en tal situación deberá hacerlo inmediatamente de superado el inconveniente; c) El conductor participante en los hechos deberá solicitar su examen de alcoholemia en el recinto asistencial más cercano, lo antes posible después de ocurrido los hechos. Para el caso de encontrarse detenido deberá exigir a la autoridad la practica del examen aun cuando aquella no lo considere procedente. d) El arrendatario o conductor deberá seguir las instrucciones que la arrendadora le imparte en lo referente al traslado del vehículo, siendo de su cargo los costos del mismo toda vez ningún seguro los cubre. DECIMO CUARTO: En caso de daños en el vehículo por accidente o choque, el arrendatario deberá dar aviso por escrito al arrendador dentro de la hora (1) siguiente de ocurrido el hecho. El arrendatario resultará único responsable de todos los perjuicios ocasionados, quedando obligado a pagarlos. En caso de no cumplir, el arrendador quedará autorizado para hacer efectiva la garantía expresada en la clausula quinta de este contrato. DECIMO QUINTO: Las partes declaran haber leído atentamente este contrato y haberlo entendido, estar plenamente enterados de las obligaciones que contraen y aceptarlas en todas sus partes sin reservas. DECIMO SEXTO: Para todos los efectos derivados del presente contrato, y de las obligaciones que puedan derivar de él o del vehículo que se da en arriendo, las partes fijan domicilio en la ciudad de Santiago y se someten a la competencia de sus tribunales');
